import React from 'react'
import "./App.css";
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Home from './Home';

function App() {
  return (
    <Router>
      <Routes>
          <Route exact path="/" component= {Home} />
      </Routes>
  </Router>
  )
}

export default App;
